(2880, 'booking_form', '<div class=\"wpbc_booking_form_structure wpbc_vertical\">\n  <div class=\"wpbc_structure_calendar\">\n    [calendar]\n  </div>\n  <div class=\"wpbc_structure_form\">\n     <p>Nombre*:<br />[text* name]</p>\n     <p>Apellido*:<br />[text* secondname]</p>\n     <p>Email*:<br />[email* email]</p>\n     <p>Teléfono*:<br />[text* phone]</p>\n     <p>Bloques de Tiempo*:<br />[select* rangetime  \"9:00 AM - 10:00 AM@@09:00 - 10:00\"  \"10:00 AM - 11:00 AM@@10:00 - 11:00\"  \"11:00 AM - 12:00 PM (Noon)@@11:00 - 12:00\"  \"12:00 PM (Noon) - 1:00 PM@@12:00 - 13:00\"  \"1:00 PM - 2:00 PM@@13:00 - 14:00\"  \"2:00 PM - 3:00 PM@@14:00 - 15:00\"  \"3:00 PM - 4:00 PM@@15:00 - 16:00\"  \"4:00 PM - 5:00 PM@@16:00 - 17:00\"  \"5:00 PM - 6:00 PM@@17:00 - 18:00\"  \"6:00 PM - 7:00 PM@@18:00 - 19:00\"]</p>\n     <p>[captcha]</p>\n     <p>[submit class:btn \"Send\"]</p>\n  </div>\n</div>\n<div class=\"wpbc_booking_form_footer\"></div>', 'yes'),
(2881, 'booking_form_show', '<div style=\"text-align:left;word-wrap: break-word;\">\n  <strong>Nombre</strong>: <span class=\"fieldvalue\">[name]</span><br/>\n  <strong>Apellido</strong>: <span class=\"fieldvalue\">[secondname]</span><br/>\n  <strong>Email</strong>: <span class=\"fieldvalue\">[email]</span><br/>\n  <strong>Teléfono</strong>: <span class=\"fieldvalue\">[phone]</span><br/>\n  <strong>Bloques de Tiempo</strong>: <span class=\"fieldvalue\">[rangetime]</span><br/>\n</div>', 'yes'),
