(265, 1, '2020-10-05 12:06:33', '2020-10-05 16:06:33', '<h4><pre data-placeholder=\"Traducción\" dir=\"ltr\" style=\"unicode-bidi: isolate; font-size: 28px; line-height: 36px; background-color: rgb(248, 249, 250); border-width: initial; border-style: none; padding: 2px 0.14em 2px 0px; position: relative; margin-top: -2px; margin-bottom: -2px; resize: none; font-family: inherit; overflow: hidden; text-align: left; width: 277px; white-space: pre-wrap; overflow-wrap: break-word; color: rgb(34, 34, 34); font-style: normal; font-weight: 400;\"><br></pre>Mira Nuestro Trabajo</h4>		\n			<h5>Echa un Vistaso  nuestros Servivios </h5>		\n			<figure><img width=\"1024\" height=\"488\" src=\"https://ditamed.net/rbg/wp-content/uploads/2020/09/camara2.jpg\" alt=\"\" loading=\"lazy\" srcset=\"https://ditamed.net/rbg/wp-content/uploads/2020/09/camara2.jpg 1024w, https://ditamed.net/rbg/wp-content/uploads/2020/09/camara2-300x143.jpg 300w, https://ditamed.net/rbg/wp-content/uploads/2020/09/camara2-768x366.jpg 768w, https://ditamed.net/rbg/wp-content/uploads/2020/09/camara2-600x286.jpg 600w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></figure><h3>Instalación de Cámaras de Seguridad<br></h3><p>Configuracion para monitoreo remoto </p>		\n			<figure><img width=\"1024\" height=\"683\" src=\"https://ditamed.net/rbg/wp-content/uploads/2020/09/rep_ord_21-1024x683-1.jpg\" alt=\"\" loading=\"lazy\" srcset=\"https://ditamed.net/rbg/wp-content/uploads/2020/09/rep_ord_21-1024x683-1.jpg 1024w, https://ditamed.net/rbg/wp-content/uploads/2020/09/rep_ord_21-1024x683-1-300x200.jpg 300w, https://ditamed.net/rbg/wp-content/uploads/2020/09/rep_ord_21-1024x683-1-768x512.jpg 768w, https://ditamed.net/rbg/wp-content/uploads/2020/09/rep_ord_21-1024x683-1-600x400.jpg 600w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></figure><h3>Servicio Técnico para Pc y Laptop </h3><p>Somos especialista en la rama con mas de 5 años de esperiencia </p>		\n			<figure><img width=\"800\" height=\"534\" src=\"https://ditam