(74, 1, '2020-09-02 11:33:15', '2020-09-02 15:33:15', '<h4>DITAMED EQUIPOS MEDICOS</h4>		\n			<a href=\"#\" role=\"button\">\n						Comprar\n					</a>\n										<img width=\"698\" height=\"511\" src=\"https://ditamed.net/wp-content/uploads/2020/09/1.jpg\" alt=\"\" srcset=\"https://ditamed.net/wp-content/uploads/2020/09/1.jpg 698w, https://ditamed.net/wp-content/uploads/2020/09/1-600x439.jpg 600w, https://ditamed.net/wp-content/uploads/2020/09/1-300x220.jpg 300w\" sizes=\"(max-width: 698px) 100vw, 698px\" />											\n				<h3>\n					EQUIPOS MEDICOS\n				</h3>\n								<p>Con el Respaldo de las Mejores Marcas</p>\n										<img width=\"698\" height=\"511\" src=\"https://ditamed.net/wp-content/uploads/2020/09/1.jpg\" alt=\"\" srcset=\"https://ditamed.net/wp-content/uploads/2020/09/1.jpg 698w, https://ditamed.net/wp-content/uploads/2020/09/1-600x439.jpg 600w, https://ditamed.net/wp-content/uploads/2020/09/1-300x220.jpg 300w\" sizes=\"(max-width: 698px) 100vw, 698px\" />											\n				<h3>\n					SERVICIO TÉCNICO DE EQUIPOS MEDICOS\n				</h3>\n								<p>Con los Mejores Profesionales del Área </p>\n										<img width=\"698\" height=\"511\" src=\"https://ditamed.net/wp-content/uploads/2020/09/1.jpg\" alt=\"\" srcset=\"https://ditamed.net/wp-content/uploads/2020/09/1.jpg 698w, https://ditamed.net/wp-content/uploads/2020/09/1-600x439.jpg 600w, https://ditamed.net/wp-content/uploads/2020/09/1-300x220.jpg 300w\" sizes=\"(max-width: 698px) 100vw, 698px\" />											\n				<h3>\n					ACCESORIOS, CONSUMIBLES Y DESCARTABLES\n				</h3>\n								<p>Con los mejores productos del mercado </p>\n			<h4>Nuestras Marcas</h4>		\n										<img width=\"120\" height=\"120\" src=\"https://ditamed.net/wp-content/uploads/2020/09/2.jpg\" alt=\"\" srcset=\"https://ditamed.net/wp-content/uploads/2020/09/2.jpg 120w, https://ditamed.net/wp-content/uploads/2020/09/2-100x100.jpg 100w\" sizes=\"(max-width: 120px) 100vw, 120px\" />											\n										<img width=\"177\" height=\"110\" src=\"h