INSERT INTO `wp_wc_admin_notes` (`note_id`, `name`, `type`, `locale`, `title`, `content`, `content_data`, `status`, `source`, `date_created`, `date_reminder`, `is_snoozable`, `layout`, `image`, `is_deleted`, `icon`) VALUES
(1, 'wc-admin-onboarding-email-marketing', 'info', 'en_US', 'Tips, product updates, and inspiration', 'We\'re here for you - get tips, product updates and inspiration straight to your email box', '{}', 'unactioned', 'woocommerce-admin', '2020-09-01 23:06:55', NULL, 0, 'plain', '', 0, 'info'),
(2, 'wc-admin-marketing-intro', 'info', 'en_US', 'Connect with your audience', 'Grow your customer base and increase your sales with marketing tools built for WooCommerce.', '{}', 'unactioned', 'woocommerce-admin', '2020-09-01 23:06:55', NULL, 0, 'plain', '', 0, 'info'),
(3, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Connect to WooCommerce.com', 'Connect to get important product notifications and updates.', '{}', 'unactioned', 'woocommerce-admin', '2020-09-01 23:06:56', NULL, 0, 'plain', '', 0, 'info'),
(4, 'wc-admin-mobile-app', 'info', 'en_US', 'Instala la aplicación móvil WooCommerce', 'Instala la aplicación móvil de WooCommerce para gestionar pedidos, recibir avisos de ventas y ver métricas clave – allí donde estés.', '{}', 'unactioned', 'woocommerce-admin', '2020-09-03 23:19:18', NULL, 0, 'plain', '', 0, 'info'),
(5, 'wc-admin-usage-tracking-opt-in', 'info', 'en_US', 'Ayuda a WooCommerce a mejorar con el seguimiento de uso', 'Recopilar datos de uso nos permite mejorar WooCommerce. Se tendrá en cuenta a tu tienda a medida que evaluamos nuevas características, juzgamos la calidad de una actualización o determinamos si una mejora tiene sentido. Siempre puedes visitar los <a href=\"https://ditamed.net/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Ajustes</a> y elegir dejar de compartir datos. <a href=\"https://woocommerce.com/usage-tracking\" target=\"_blank\">Lee más</a> sobre los datos que recopilamos.', '{}', 'unactioned', 'woocommerce-admin', '2020-09-17 17:10:11', NULL, 0, 'plain', '', 0, 'info'),
(6, 'wc-admin-onboarding-payments-reminder', 'info', 'en_US', '¡Empieza a aceptar pagos en tu tienda!', 'Acepta pagos mediante el proveedor adecuado para ti - elige entre más de 100 pasarelas de pago para WooCommerce.', '{}', 'unactioned', 'woocommerce-admin', '2020-09-17 17:10:11', NULL, 0, 'plain', '', 0, 'info'),
(7, 'wc-admin-store-notice-giving-feedback-2', 'info', 'en_US', 'Da tu opinión', 'Ahora que nos has elegido como socio, nuestro objetivo es asegurarnos de que proporcionemos las herramientas adecuadas para satisfacer tus necesidades. Esperamos recibir tus comentarios sobre la experiencia de configuración de la tienda para que podamos mejorarla en el futuro.', '{}', 'unactioned', 'woocommerce-admin', '2020-09-17 17:10:11', NULL, 0, 'plain', '', 0, 'info'),
(8, 'wc-admin-insight-first-sale', 'survey', 'en_US', '¿Sabías que?', 'Una tienda que funciona con WooCommerce necesita un promedio de 31 días para conseguir su primera venta. ¡Estás en el camino correcto! ¿Encontraste útil este tipo de estadística?', '{}', 'unactioned', 'woocommerce-admin', '2020-09-17 17:10:11', NULL, 0, 'plain', '', 0, 'info'),
(9, 'wc-admin-home-screen-feedback', 'info', 'en_US', 'Ayúdanos a mejorar la pantalla de inicio de WooCommerce', 'Nos encantaría saber tu opinión para dar forma al futuro de la pantalla de inicio de WooCommerce juntos. No dudes en compartir cualquier comentario, idea o sugerencia que tengas.', '{}', 'unactioned', 'woocommerce-admin', '2020-09-17 17:10:11', NULL, 0, 'plain', '', 0, 'info'),
(10, 'wc-update-db-reminder', 'update', 'en_US', 'Actualización de la base de datos de WooCommerce terminada', 'Actualización de la base de datos de WooCommerce completa. ¡Gracias por actualizar a la última versión!', '{}', 'actioned', 'woocommerce-core', '2020-09-23 08:25:47', NULL, 0, 'plain', '', 0, 'info'),
(12, 'ecomm-need-help-setting-up-your-store', 'info', 'en_US', 'Need help setting up your Store?', 'Schedule a free 30-min <a href=\"https://wordpress.com/support/concierge-support/\">quick start session</a> and get help from our specialists. We’re happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.', '{}', 'pending', 'woocommerce.com', '2020-10-18 00:04:58', NULL, 0, 'plain', '', 0, 'info'),
(13, 'woocommerce-services', 'info', 'en_US', 'WooCommerce Shipping & Tax', 'WooCommerce Shipping &amp; Tax helps get your store “ready to sell” as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.', '{}', 'pending', 'woocommerce.com', '2020-10-18 00:04:58', NULL, 0, 'plain', '', 0, 'info'),
(14, 'ecomm-unique-shopping-experience', 'info', 'en_US', 'For a shopping experience as unique as your customers', 'Product Add-Ons allow your customers to personalize products while they’re shopping on your online store. No more follow-up email requests—customers get what they want, before they’re done checking out. Learn more about this extension that comes included in your plan.', '{}', 'pending', 'woocommerce.com', '2020-10-18 00:04:58', NULL, 0, 'plain', '', 0, 'info');
